a=require(game.ReplicatedStorage.Modules.ItemService.ItemData)()
local master = ""
function clean(data)
for x,y in pairs(data) do
if y["PartOf"]~=nil then
y["PartOf"]=nil
elseif y["MainItem"]~= nil then
y["MainItem"]=nil
elseif y["Parts"]~=nil then
y["Parts"]=nil end
end
end
for i,v in pairs(a) do
--clean(v)
if i ~= "Decorations" then
	clean(v)
	master = master .. "[\""..i.."\"] = "..table_to_string(v)..",\n"
else
	master = master .. "[\"Decorations\"] = {"
	for x,y in pairs(v) do clean(y) master = master ..  "[\""..x.."\"] = "..table_to_string(y)..",\n" end
	master = master .. "},\n"
end
